                return false;
            }
            if (Character.isUpperCase(entry.getKey().charAt(0)) && !Character.isUpperCase(entry.getValue().charAt(0))) {
                return false;
            }
            if (Character.isLowerCase(entry.getKey().charAt(0)) && !Character.isLowerCase(entry.getValue().charAt(0))) {
                return false;
            }
